import * as React from 'react';
import { VFC } from 'react';
import CssBaseline from '@material-ui/core/CssBaseline';
import Grid from '@material-ui/core/Grid';
import Container from '@material-ui/core/Container';
import TwitterIcon from '@material-ui/icons/Twitter';
import Typography from '@material-ui/core/Typography';
import Divider from '@material-ui/core/Divider';
import MainFeaturedPost from './MainFeaturedPost';
import Header from './Header';
import Footer from './Footer';
import topImg from './images/top.png'; 
import logoImg from './images/manaLogo.png'; 


const sections = [
  { title: 'トップ', url: '#' }
  // { title: 'Design', url: '#' },
  // { title: 'Culture', url: '#' },
  // { title: 'Business', url: '#' },
  // { title: 'Politics', url: '#' },
  // { title: 'Opinion', url: '#' },
  // { title: 'Science', url: '#' },
  // { title: 'Health', url: '#' },
  // { title: 'Style', url: '#' },
  // { title: 'Travel', url: '#' },
];

const mainFeaturedPost = {
  title: '株式会社mana',
  description:
    "このサイトは、株式会社manaのポートフォリオサイトです。",
  image: topImg,
  imageText: 'main image description',
  linkText: 'Continue reading…',
};

const social={ name: 'Twitter', icon: TwitterIcon }

const Blog: VFC = () => (
  <>
    <CssBaseline />
    <Container maxWidth="lg">
      <Header title="建築　×　IT　の境界を切り拓く" sections={sections} />
      <main>
        <MainFeaturedPost post={mainFeaturedPost} />

        <Grid container alignItems="center" justifyContent="center" sx={{ mt: 3 }} spacing={3}>
          <Grid item xs={12}>
            <Typography variant="h6" gutterBottom>
              manaについて
            </Typography>
            <Divider />
          </Grid>
          <Grid item xs={2}>
            <img style={{ width: '100%' }}  src= {logoImg} alt='description' />
          </Grid>
          <Grid item xs={10}>
            2015年に設立。<br/>
            意匠・設備・法規・構造・施工にまたがる、建築に関するオールラウンドな知識・経験と、情報処理分野に関する専門性を生かし、
            建築業界に新たは価値の提供を行い、また、新たな働き方を提案する。
          </Grid>
        </Grid>
        <Grid container alignItems="center" justifyContent="center" sx={{ mt: 3 }} spacing={3}>
          <Grid item xs={12}>
            <Typography variant="h6" gutterBottom>
              プロジェクト
            </Typography>
            <Divider />
          </Grid>
          <Grid item xs={2}>
            <img style={{ width: '100%' }}  src= {logoImg} alt='description' />
          </Grid>
          <Grid item xs={10}>
            2015年に設立。<br/>
            意匠・設備・法規・構造・施工にまたがる、建築に関するオールラウンドな知識・経験と、情報処理分野に関する専門性を生かし、
            建築業界に新たは価値の提供を行い、また、新たな働き方を提案する。
          </Grid>
        </Grid>
      </main>
    </Container>
    <Footer
      title="会社情報"
      description="2015年設立　東京都江東区東陽"
      social={social}
    />
  </>
);

export default Blog;
